import React from 'react';
import { Card, Button, CardImg, CardTitle, CardText, CardDeck,
  CardSubtitle, CardBody } from 'reactstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>¡Hola!</h1>
      <p>Este material provee el vocabulario básico en inglés para las personas que trabajan en jardinería.  Todo el contenido de este libro
        fue desarrollado por jornaleros y jornaleras que trabajen en la jardinería.  Practique para mejorar la comunicación con sus empleadores
        y para tener éxito en el trabajo.
      </p>

      <h2>Start of the workday - Inicio del día de trabajo</h2>
      <Card>
        <CardTitle>
          Good Morning
        </CardTitle>
        <CardBody>
          <CardText>
            Good Morning [gud mornin] - Buenos días
          </CardText>
        </CardBody>
      </Card>
    </div>
  );
}

export default App;
